import React from "react";
import { Helmet } from "react-helmet"
import Hero from "../../components/Hero/Hero";

const Home = () => {
  return (
    <div className="blur">
      <Helmet>
        <script
          src="https://www.myscripts.com/scripts"
          crossorigin="anonymous"
          async
        ></script>
      </Helmet>
      <Hero />
    </div>
  );
};

export default Home;
